import React from "react";
import { Link } from 'react-router-dom';
import {data} from './data';





export const Users = () =>{
    const user = [
        {
            name: 'Adi',
            surname: 'Gonsiore',
            age: 18

        },
        {
            name: 'Seba',
            surname: 'Gonsiore',
            age: 13

        }
    ]
    console.log('data:', data)

    console.log('user:',user)




    return(

        <div>
            {
            user.map((user:any) =>
                <Link key={user.name} {...Users} to={`/users/${user.name}`}>{user.name}</Link>
            )}



        </div>
    )
}
